    [],nt"revision_timestamp": "2016-07-27T23:04:41.265653",nt"name": "waterfowl-breeding-population-and-habitat-survey",nt"isopen":
    false,nt"url": null,nt"notes": "The Waterfowl Breeding Population and Habitat
    Survey was initiated experimentally in 1947 and became operational in 1955.  It
    is conducted cooperatively by the U.S. Fish and Wildlife Service and Canadian Wildlife
    Service. It has been conducted every year since. The primary purpose of the survey
    is to provide information on spring population size and trajectory for certain North
    American duck species. These data are used extensively in the annual establishment
    of hunting regulations in the United States and Canada and provide long-term time
    series important in researching bird-environment relationships critical to effective
    conservation planning for waterfowl.",nt"license_title": "License Not Specified",nt"extras":
